import React from 'react';

class MovieCards extends React.Component {
  render() {
    const { movies: { title, subtitle, storyline, rating, imagePath } } = this.props;
    return (
      <p>
        {title}
        {subtitle}
        {storyline}
        {rating}
        {imagePath}
      </p>
    );
  }
}

export default MovieCards;
